import React from 'react';
import './EncabezadoLista.css';
import Table from 'react-bootstrap/Table'

const EncabezadoLista = () => {
    return (
    <Table striped bordered hover>
    <thead>
        <tr>
        <th>#</th>
        <th>First Name</th>
        <th>Last Name</th>
        <th>Username</th>
        </tr>
    </thead>
    
    </Table>
  );
}

export default EncabezadoLista;
